import React, { useContext } from "react";
import SettingContext from "../src/components/todo/context/context";
import Header from "../src/components/Header";
import ToDo from ".";
import Footer from "../src/components/Footer";
import "./App.scss";
import Login from "../src/components/todo/context/login";
import { LoginContext } from "../src/components/todo/context/loginContext";
import { If, Then, Else } from "react-if";
import Signup from "./";

export default function App(props) {
  const context = useContext(LoginContext);

  return (
    <>
      <If condition={context.loggedIn == true}>
        {console.log(context)}
        <Then>
          <SettingContext>
            <Header />
            <ToDo />

            <Footer />

            <SettingContext />
          </SettingContext>
        </Then>
        <Else>
          <Login />

          <Signup />
        </Else>
      </If>
    </>
  );
}
